import { Col, Container, Row } from "react-bootstrap";

const BookComplete = ({ bookcomplete }) => {
  return (
    <>
      <Container>
        <Row>
          {bookcomplete.map((item, ix) => {
            return (
              <Col>
                <div className="book-complete-box">
                  <img src={item.daImgComplete} alt="" />
                </div>
              </Col>
            );
          })}
        </Row>
      </Container>
    </>
  );
};

export default BookComplete;
